import styled from "styled-components";

export const StyledContent = styled.div`
div > div {
    display: flex;
  flex-direction: column;
  background-color: red;

  margin: 5px 5px 5px 5px;
  border: 1px solid black;
  border-radius: 3px;
}
  
`;
